import "./Titleimage.css"


function TitleImage() {
    return(
        <section id="image-section">

            <img src="https://images.unsplash.com/photo-1586985290301-8db40143d525?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mjl8fGNha2V8ZW58MHwwfDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60" />

        </section>
    )
}


export default TitleImage
